import Link from "next/link";

export default function Home() {
  return (
    <>
      {process.env.customKey} Hello Word
      <ul>
        <li>
          <Link href="/detalhes">
            <a>About Us</a>
          </Link>
        </li>
      </ul>
    </>
  );
}
